import React from 'react';

var data = ['Ruler', 'Pen', 'Book'];

class Item extends React.Component {
  render() {
    return (
    <li>{this.props.name}</li>
    )
  }
}

class App extends React.Component {
  render() {
    return (
      <div>
        <h1>Hello React</h1>
        <p>USER NAME: KYAW GYI</p>
        <ul>
          {data.map( i => {
            return (<Item name={i}/>)
          })}
        </ul>
      </div> 
    )
  }
}

export default App;
